import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { useState } from 'react';
import InputLabel from '@mui/material/InputLabel';
import MenuItem from '@mui/material/MenuItem';
import FormControl from '@mui/material/FormControl';
import Select from '@mui/material/Select';
import styled from 'styled-components'


const Container = styled.div`
display: block ;
position: absolute  
form{
  position: absolute  
}
Button{


}
`


export default function FormPropsTextFields() {
const [nome, setNome] =  useState({})
const [marca, setMarca] =  useState({})
const [uni, setUni] =  useState({})
const handleChange = (event) => {
  setUni(event.target.value);
};
const handleSubmit = evt => {
evt.preventDefault()
fetch("http://localhost:3002/produto/cadastro", {
headers: {"Content-Type": "application/json"},
method: "POST",
body: JSON.stringify({nome: nome,
marca: marca,
unidade: uni})}).then(response => response.json())
.then(response => console.log("Success:", JSON.stringify(response)))
.catch(error => console.error("Error:", error));
}

  return (
    
    <Box
      sx={{
        '& .MuiTextField-root': { m: 1, width: '25ch' },
      }}
      noValidate
      autoComplete="off"
    > <Container>
      <form>
      <div>
        <TextField
          required
          id="outlined-required"
          label="Produto"
          name = "nome"
          onInput={e=>setNome(e.target.value)}
          
        />
        
        <TextField
          required
          name = "marca"
          id="outlined-disabled"
          label="Marca"
          onInput={e=>setMarca(e.target.value)}
          />  
    <Box sx={{ maxWidth: 150 }}>
      <FormControl fullWidth>
        <InputLabel id="demo-simple-select-label">Unidade</InputLabel>
        <Select
          labelId="demo-simple-select-label"
          id="demo-simple-select"
          value={uni}
          label="Age"
          onChange={handleChange}
        >
          <MenuItem value={"m"}>metros</MenuItem>
          <MenuItem value={"uni"}>unidade</MenuItem>
          <MenuItem value={"kg"}>peso</MenuItem>
        </Select>
      </FormControl>
    </Box>
        <Button type="submit" onClick={handleSubmit}>Cadastrar</Button>
        <div> {console.log(nome,marca,uni )}</div>
        
    </div>
    </form>
    </Container>
    </Box>
    
    )
}
